description:
Verenigde Staten
Drama / Komedie
115 minuten

een goeie film

met Robin Williams, Laura Linney en Christopher Walken

Tom Dobbs is de host van een late night talkshow op de televisie. Tijdens zijn show maakt hij grappen over onderwerpen uit de 
wereld en de politiek. Als grap besluit Dobbs zich verkiesbaar te stellen voor het presidentschap. Dobbs wint uiteindelijk de 
verkiezingen, maar weet niet dat dit komt doordat er met de computer is gerommeld. Dobbs heeft ondertussen zijn eigen zorgen: zal 
hij weer televisie gaan maken of zal hij in het Witte Huis blijven...?:
